import React from "react";
import styled from "styled-components";

const NavContainer = styled.div`
  height: 100px;
  display: flex;
  justify-content: space-between;
`;

const LogoHolder = styled.div``;

const Nav = styled.nav`
  color: #767676;
`;

export const Navbar = () => {
  return (
    <NavContainer>
      <LogoHolder>
        <h1>Axios.io</h1>
      </LogoHolder>
      <Nav>
        <ul>
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">Services</a>
          </li>
          <li>
            <a href="#">About Us</a>
          </li>
          <li>
            <a href="#">Contact</a>
          </li>
        </ul>
      </Nav>
    </NavContainer>
  );
};
